import "./sidebar.css"

export default function Sidebar() {
    return (
        <div className="sidebar">
            <div className="sidebarItem">
                <span className="sidebarTitle">ABOUT ME</span>
                <img src="https://images.pexels.com/photos/4974914/pexels-photo-4974914.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260" alt="programmer" />
                <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Reiciendis id, error exercitationem delectus nisi iure!</p>
            </div>
        </div>
    )
}
